using System;
using System.Diagnostics;

namespace SpanAndMemory
{
    class Program
    {
        //span System.Span<T> --可以表示任意内存达的相邻区域，无论相应内存与托管对象相关联，
        //还是通过互操作由本级代码提供，亦或是位于堆栈上。能确保安全访问和高性能特性。
        static void Main(string[] args)
        {
            SpanVsStringIndex();
        }

        public static void SpanVsStringIndex()
        {
            string comparaStr = "data:image/png;base64,**";
            var compareSpan = comparaStr.AsSpan();
            Stopwatch sw = new Stopwatch();
            sw.Start();
            for (int i = 0; i < 10000; i++)
            {
                comparaStr.Substring(comparaStr.IndexOf("IsSa"), 20);
            }
            sw.Stop();
            Console.WriteLine($"string time:{sw.ElapsedMilliseconds}");
            sw.Reset();
            sw.Start();
            for (int i = 0; i < 10000; i++)
            {
                compareSpan.Slice(compareSpan.IndexOf("IsSa"), 20);
            }
            sw.Stop();
            Console.WriteLine($"span time:{sw.ElapsedMilliseconds}");
        }
    }
}
